import React from 'react'

const Reducer = () => {
  return (
    <div>

        <form action="">
        <input  className='inp_css' type="email" />
        <input  className='inp_css' type="password" />
        <input  className='btn_css' type="submit" />

        </form>
     
    </div>
  )
}

export default Reducer
